import {defineConfig,devices} from '@playwright/test';

export default defineConfig({
    testDir: './tests',
    timeout: 30 *1000,
    reporter: [
        ['html'],
        ['list']
    ],
    use: {
        headless: false,
        baseURL : 'https://www.saucedemo.com/',
        viewport: {width: 1280, height: 720},
        actionTimeout: 10 * 1000,
        ignoreHTTPSErrors: true,    
    },
    projects: [
        {
            name: 'chromium',
            use: {...devices['Desktop Chrome']}
        },
        {
            name: 'firefox',
            use: {...devices['Desktop Firefox']}
        },
        {
            name: 'webkit',
            use: {...devices['Desktop Safari']}
        }
    ]
});

import {test, expect} from './fixtures';
import {APP_URLS, TEST_USERS, PAGE_LABELS, ADD_TO_CART_CONFIG} from '../testData/testConstants';

test.describe('SauceDemo Login Flow', () => {

    /**
     * User adds 3 items to cart and completes a full checkout flow
     * This is the basic happy path scenario
     */
    test('Happy Flow - Basic Checkout', async ({page, homePage, checkoutPage}) => {
        await homePage.addItemToCart(ADD_TO_CART_CONFIG.ITEMS_TO_ADD_BASIC);
        const selectedItems = homePage.getSelectedItemNames();
        const selectedPrices = homePage.getSelectedItemPrices();
        const totalPrice = homePage.getTotalPrice();
        console.log('Selected items:', selectedItems);
        console.log('Selected prices:', selectedPrices);
        console.log('Total price:', totalPrice);
        
         
        // Verify items are added
        await homePage.verifyRemoveButton();
        await expect(homePage.verifyRemoveButton()).resolves.toBe(PAGE_LABELS.REMOVE_BUTTON_TEXT);
        await expect(homePage.verifyAddToCartCount()).resolves.toBe('3');
        
        // Navigate to cart
        await homePage.clickOnCartIcon();
        
        // Verify item names in cart
        await expect(checkoutPage.verifyItemNamesInCart(selectedItems)).resolves.toBeTruthy();
        
        await checkoutPage.clickCheckoutButton();
        await expect(checkoutPage.validateCheckoutPage()).resolves.toBeTruthy();
        
        // Enter checkout information
        await checkoutPage.enterCheckoutInformation(TEST_USERS.HAPPY_FLOW.firstName, TEST_USERS.HAPPY_FLOW.lastName, TEST_USERS.HAPPY_FLOW.postalCode);
        await expect(page).toHaveURL(APP_URLS.CHECKOUT_OVERVIEW_PAGE);
        await expect(checkoutPage.checkoutPageTitle()).resolves.toBe(PAGE_LABELS.CHECKOUT_OVERVIEW_TITLE);
        
        // Verify item names in checkout overview
        await expect(checkoutPage.verifyItemNamesInCart(selectedItems)).resolves.toBeTruthy();
        
        // Verify total price
        const expectedTotal = homePage.getTotalPrice();
        await expect(checkoutPage.verifyTotalPrice(expectedTotal)).resolves.toBeTruthy();
        console.log('Verified checkout total: $' + expectedTotal.toFixed(2));
        
        // Complete checkout
        await checkoutPage.clickFinishButton();
        await expect(page).toHaveURL(APP_URLS.ORDER_COMPLETE_PAGE);
        await expect(checkoutPage.validateOrderCompletion()).resolves.toBeTruthy();
    });

    /**
     * User adds 3 items, removes 1 from cart, then verifies the cart updates correctly
     * This tests cart modification functionality
     */
    test('Complex Happy Flow - Cart Modification & Checkout', async ({page, homePage, checkoutPage}) => {
        
        // Add 3 random items to cart
        await homePage.addItemToCart(ADD_TO_CART_CONFIG.ITEMS_TO_ADD_BASIC);
        const selectedItems = homePage.getSelectedItemNames();
        console.log('Selected items:', selectedItems);
        
        // Verify 3 items added
        await expect(homePage.verifyAddToCartCount()).resolves.toBe('3');
        
        // Remove one item
        await homePage.removeFirstItem();
        
        // Verify cart count is now 2
        await expect(homePage.verifyAddToCartCount()).resolves.toBe('2');
        await homePage.clickOnCartIcon();
        await expect(page).toHaveURL(APP_URLS.CART_PAGE);
        
        // Verify only 2 items are in cart
        const remainingItems = selectedItems.slice(1);
        await expect(checkoutPage.verifyItemNamesInCart(remainingItems)).resolves.toBeTruthy();
    });

    /**
     * User adds items from inventory, opens product details page, adds another item,
     * then returns to inventory before completing checkout
     * This tests the product details page flow
     */
    test('Complex Happy Flow - Product Details & Multi-Step Checkout', async ({page, homePage, checkoutPage}) => {
        
        // Add 2 more random items
        await homePage.addItemToCart(ADD_TO_CART_CONFIG.ITEMS_TO_ADD_COMPLEX);

        // Open 3rd item details
        await homePage.openItemDetails(2);
        
        // Add item from details page
        await homePage.addFromDetailsPage();
        console.log('Selected items so far:', homePage.getSelectedItemNames());
        
        // Go back to inventory
        await homePage.goBack();
        await page.waitForTimeout(ADD_TO_CART_CONFIG.WAIT_TIME_MS);
        

        const selectedItems = homePage.getSelectedItemNames();
        const selectedPrices = homePage.getSelectedItemPrices();
        const totalPrice = homePage.getTotalPrice();
        console.log('All selected items:', selectedItems);
        console.log('Selected prices:', selectedPrices);
        console.log('Total price:', totalPrice);
        
        // Verify 3 items added
        await expect(homePage.verifyAddToCartCount()).resolves.toBe('3');
        await homePage.clickOnCartIcon();
        
        // Verify item names in cart
        await expect(checkoutPage.verifyItemNamesInCart(selectedItems)).resolves.toBeTruthy();
        await checkoutPage.clickCheckoutButton();
        await expect(checkoutPage.validateCheckoutPage()).resolves.toBeTruthy();
        
        // Enter checkout information
        await checkoutPage.enterCheckoutInformation(TEST_USERS.COMPLEX_FLOW.firstName, TEST_USERS.COMPLEX_FLOW.lastName, TEST_USERS.COMPLEX_FLOW.postalCode);
        await expect(page).toHaveURL(APP_URLS.CHECKOUT_OVERVIEW_PAGE);
        await expect(checkoutPage.checkoutPageTitle()).resolves.toBe(PAGE_LABELS.CHECKOUT_OVERVIEW_TITLE);
        
        // Verify item names in checkout overview
        await expect(checkoutPage.verifyItemNamesInCart(selectedItems)).resolves.toBeTruthy();
        
        // Complete checkout
        await checkoutPage.clickFinishButton();
        await expect(page).toHaveURL(APP_URLS.ORDER_COMPLETE_PAGE);
        await expect(checkoutPage.validateOrderCompletion()).resolves.toBeTruthy();
    });
});

import {test as base, expect} from '@playwright/test';
import {LoginPage} from '../pages/loginPage';
import {HomePage} from '../pages/homePage';
import {CheckoutPage} from '../pages/checkoutPage';
import {APP_URLS} from '../testData/testConstants';
import dotenv from 'dotenv';

// Load environment variables from .env file
dotenv.config();

/**
 * Define the shape of custom fixtures
 * These fixtures will be injected automatically into every test
 */
type TestFixtures = {
  loginPage: LoginPage;
  homePage: HomePage;
  checkoutPage: CheckoutPage;
};

/**
 * Extend Playwright's base test with custom fixtures
 * This provides page object instances to all tests without manual initialization
 */
export const test = base.extend<TestFixtures>({
  /**
   * Fixture: LoginPage instance
   * Provides methods for login operations
   */
  loginPage: async ({page}, use) => {
    const loginPage = new LoginPage(page);
    await use(loginPage);
  },

  /**
   * Fixture: HomePage instance
   * Provides methods for home/inventory page operations
   */
  homePage: async ({page}, use) => {
    const homePage = new HomePage(page);
    await use(homePage);
  },

  /**
   * Fixture: CheckoutPage instance
   * Provides methods for checkout and cart operations
   */
  checkoutPage: async ({page}, use) => {
    const checkoutPage = new CheckoutPage(page);
    await use(checkoutPage);
  },
});

/**
 * Setup hook: Runs before each test
 * Automatically logs in the user and navigates to inventory page
 * This ensures every test starts with an authenticated user
 */
test.beforeEach(async ({page, loginPage}) => {
  await loginPage.navigatetoLoginPage();
  await loginPage.loginToSauceLabs(process.env.SAUCE_USERNAME!, process.env.SAUCE_PASSWORD!);
  await page.goto(APP_URLS.INVENTORY_PAGE);
});

export {expect};

import {Page, expect} from '@playwright/test';


export class LoginPage {
    readonly page: Page;

    constructor(page:Page){
        this.page = page;
    }
    async navigatetoLoginPage() {
        await this.page.goto('/');
    }

    async loginToSauceLabs(username: string, password: string) {
        await this.page.getByPlaceholder('Username').fill(username);
        await this.page.getByPlaceholder('Password').fill(password);
        await this.page.click('#login-button');
    }

    async validateHomePage(){
        return await this.page.locator('//div[@class= "app_logo"]').isVisible();
    }
}

import {Page, expect} from '@playwright/test';


export class HomePage {
    readonly page: Page;
    private selectedItemNames: string[] = [];
    private selectedItemPrices: number[] = [];

    constructor(page:Page){
        this.page = page;
    }

    async addItemToCart(count: number = 3){
        for (let i = 0; i < count; i++) {
            const item = this.page.locator('//div[@class="inventory_item"]').nth(i);
            const itemName = await item.locator('.inventory_item_name').textContent();
            const itemPrice = await item.locator('.inventory_item_price').textContent();
            
            if (itemName) {
                this.selectedItemNames.push(itemName.trim());
            }
            if (itemPrice) {
                const price = parseFloat(itemPrice.replace('$', ''));
                this.selectedItemPrices.push(price);
            }
            await item.locator('button').click();
        }
    }

    getSelectedItemNames(): string[] {
        return this.selectedItemNames;
    }

    getSelectedItemPrices(): number[] {
        return this.selectedItemPrices;
    }

    getTotalPrice(): number {
    let total = 0;
    this.selectedItemPrices.forEach(price => total += price);
    return total;
   }

    async verifyRemoveButton(){
        const removeButttonText = await this.page.locator('#remove-sauce-labs-backpack').textContent();
        return removeButttonText
        
    }

    async verifyAddToCartCount(){
        const cartCount = await this.page.locator('//span[@class="shopping_cart_badge"]').textContent();
        return cartCount
        
    }

    async clickOnCartIcon(){
        await this.page.locator('.shopping_cart_link').click();
    }

    async removeFirstItem(){
        const firstItem = this.page.locator('//div[@class="inventory_item"]').first();
        await firstItem.locator('button:has-text("Remove")').click();
    }

    async openItemDetails(index: number){
        const item = this.page.locator('//div[@class="inventory_item"]').nth(index);
        await item.locator('.inventory_item_name').click();
    }

    async addFromDetailsPage(){
        const itemName = await this.page.locator('[data-test="inventory-item-name"]').textContent();
        const itemPrice = await this.page.locator('[data-test="inventory-item-price"]').textContent();

        if (itemName) {
            this.selectedItemNames.push(itemName.trim());
        }
        if (itemPrice) {
            const price = parseFloat(itemPrice.replace('$', ''));
            this.selectedItemPrices.push(price);
        }
        await this.page.locator('//button[contains(text(), "Add to cart")]').click();
    }

        async goBack(){
            await this.page.locator('#back-to-products').click();
        }
    }

import {Page, expect} from '@playwright/test';


export class CheckoutPage {
    readonly page: Page;

    constructor(page:Page){
        this.page = page;
    }


    async clickCheckoutButton(){
        await this.page.locator('//button[text()="Checkout"]').click();
    }

    async validateCheckoutPage(){
        return await this.page.locator('//span[text()="Checkout: Your Information"]').isVisible();
    }

    async enterCheckoutInformation(firstName: string, lastName: string, postalCode: string){
        await this.page.getByPlaceholder('First Name').fill(firstName);
        await this.page.getByPlaceholder('Last Name').fill(lastName);
        await this.page.getByPlaceholder('Zip/Postal Code').fill(postalCode);
        await this.page.click('#continue');
    }

    async checkoutPageTitle(){
        const title = await this.page.locator('//span[@class="title"]').textContent();
        return title;
    }

    async clickFinishButton(){
        await this.page.locator('//button[text()="Finish"]').click();
    }

    async validateOrderCompletion(){
        return await this.page.locator('//h2[text()="Thank you for your order!"]').isVisible();
    }

    async verifyItemNamesInCart(itemNames: string[]): Promise<boolean> {
        for (const itemName of itemNames) {
            const isVisible = await this.page.locator(`//div[text()="${itemName}"]`).isVisible();
            if (!isVisible) {
                return false;
            }
        }
        return true;
    }

    async getCheckoutTotal(): Promise<number> {
        const subtotalText = await this.page.locator('//div[@class="summary_subtotal_label"]').textContent();
        if (subtotalText) {
            const priceString = subtotalText.replace('Item total: $', '').trim();
            return parseFloat(priceString);
        }
        return 0;
    }

    async verifyTotalPrice(expectedTotal: number): Promise<boolean> {
        const actualTotal = await this.getCheckoutTotal();
        console.log('Expected subtotal:', expectedTotal);
        console.log('Actual subtotal from checkout:', actualTotal);
        return actualTotal === expectedTotal;
    }
    
}

export const APP_URLS = {
    LOGIN_PAGE: 'https://www.saucedemo.com/',
    INVENTORY_PAGE: 'https://www.saucedemo.com/inventory.html',
    CART_PAGE: 'https://www.saucedemo.com/cart.html',
    CHECKOUT_PAGE: 'https://www.saucedemo.com/checkout-step-one.html',
    CHECKOUT_OVERVIEW_PAGE: 'https://www.saucedemo.com/checkout-step-two.html',
    ORDER_COMPLETE_PAGE: 'https://www.saucedemo.com/checkout-complete.html',
};

// Test Data for users
export const TEST_USERS = {
    HAPPY_FLOW: {
        firstName: 'John',
        lastName: 'Doe',
        postalCode: '12345',
    },
    COMPLEX_FLOW: {
        firstName: 'Jane',
        lastName: 'Doe',
        postalCode: '54321',
    },
};

export const PAGE_LABELS = {
    REMOVE_BUTTON_TEXT: 'Remove',
    CHECKOUT_OVERVIEW_TITLE: 'Checkout: Overview',
};

export const ADD_TO_CART_CONFIG = {
    ITEMS_TO_ADD_BASIC: 3,
    ITEMS_TO_ADD_COMPLEX: 2,
    WAIT_TIME_MS: 1000,
};
